class ToggleLike{constructor(e){this.element=e,this.toggleLike()}toggleLike(){$(this.element).click((function(e){e.preventDefault();let t=this;$.ajax({type:"post",url:$(t).attr("href"),success:function(e){var l=parseInt($(t).attr("data-likes"));1==e.data.deleted&&(l-=1,console.log("Like removed")),0==e.data.deleted&&(l+=1,console.log("new like added")),$(t).attr("data-likes",l),$(t).html(l+" Likes")},error:function(e){console.log(e.responseText)}})}))}}